public enum FormulaError {

    
    
    case ParseError(message: String)
    
    case UnknownVariable(message: String)
    
    case UnknownFunction(message: String)
    
    case TypeError(message: String)
    
    case DivisionByZero(message: String)
    
    case InvalidArgCount(message: String)
    
    case EmptyExpression(message: String)
    
}


#if swift(>=5.8)
@_documentation(visibility: private)
#endif
public struct FfiConverterTypeFormulaError: FfiConverterRustBuffer {
    typealias SwiftType = FormulaError

    public static func read(from buf: inout (data: Data, offset: Data.Index)) throws -> FormulaError {
        let variant: Int32 = try readInt(&buf)
        switch variant {

        

        
        case 1: return .ParseError(
            message: try FfiConverterString.read(from: &buf)
        )
        
        case 2: return .UnknownVariable(
            message: try FfiConverterString.read(from: &buf)
        )
        
        case 3: return .UnknownFunction(
            message: try FfiConverterString.read(from: &buf)
        )
        
        case 4: return .TypeError(
            message: try FfiConverterString.read(from: &buf)
        )
        
        case 5: return .DivisionByZero(
            message: try FfiConverterString.read(from: &buf)
        )
        
        case 6: return .InvalidArgCount(
            message: try FfiConverterString.read(from: &buf)
        )
        
        case 7: return .EmptyExpression(
            message: try FfiConverterString.read(from: &buf)
        )
        

        default: throw UniffiInternalError.unexpectedEnumCase
        }
    }

    public static func write(_ value: FormulaError, into buf: inout [UInt8]) {
        switch value {

        

        
        case .ParseError(_ /* message is ignored*/):
            writeInt(&buf, Int32(1))
        case .UnknownVariable(_ /* message is ignored*/):
            writeInt(&buf, Int32(2))
        case .UnknownFunction(_ /* message is ignored*/):
            writeInt(&buf, Int32(3))
        case .TypeError(_ /* message is ignored*/):
            writeInt(&buf, Int32(4))
        case .DivisionByZero(_ /* message is ignored*/):
            writeInt(&buf, Int32(5))
        case .InvalidArgCount(_ /* message is ignored*/):
            writeInt(&buf, Int32(6))
        case .EmptyExpression(_ /* message is ignored*/):
            writeInt(&buf, Int32(7))

        
        }
    }
}


